import React from "react";

export interface BubblePhotoProps {
	image: string;
	size: string;
}

class BubblePhoto extends React.Component<BubblePhotoProps, {}> {
	constructor(props: BubblePhotoProps) {
		super(props);
	}

	render() {
		return (
			<div className="BubblePhoto">
				<Circle diameter={this.props.size} backgroundImage={this.props.image} />
				<Circle diameter={this.props.size} />
			</div>
		);
	}
}

export default BubblePhoto;
